import React from 'react'
import "./Popup.css"

function Popup(props) {
    return (props.trigger) ? (
        <div className="popup">
            <div className="popup-inner">
                <button onClick={() => props.setTrigger(false)}>X</button>
                <textarea name="" id="" cols="30" rows="10"></textarea>
            </div>

        </div>
    ) : "";

}

export default Popup
